import React from "react";

const RouterComponent = () => {

    return (
    <BrowserRouter>
        <Routes>
        <Route path="/" element={<Home/>}>
            <Route index element={<Home/>}/>
            {
            <Route path={`category/${useSelector(selectBmiCategory)}`} element={<BMIRecomendation/>}/>
            }
        </Route>
        </Routes>
    </BrowserRouter>
)};

export default RouterComponent;
